import React from "react";


const NumericText = ({rows}) => {
    return (
        <section className="columnsText">
            <div className="container">
                <h2>{rows.heading}</h2>
                <div className="columns">
                    {rows.item.map((item) => {
                    return(
                        <div className="item">
                            <h2>{item.heading}</h2>
                            <p>{item.textColumn}</p>
                        </div>
                    );
                    })}
                </div>
            </div>
        </section>
    );
};

export default NumericText;
